import React from "react";

function Cell({ value, onChange, onFocus }) {
  return (
    <input
      type="text"
      value={value}
      onChange={(e) => onChange(e.target.value)}
      onFocus={onFocus}
      style={{
        border: "1px solid #ddd",
        padding: "5px",
        minWidth: "50px",
      }}
    />
  );
}

export default Cell;
